import { Injectable } from '@angular/core';
import {Link} from "../../models/link.model";

@Injectable({
  providedIn: 'root'
})
export class LinkService {

  linkDetail: Link = {
    category: 'programming',
    blacklistFlag: ['nsfw'],
    type: 'single'
  }

  constructor() { }
}
